        </ControlLabel> */}

        <div onSubmit={onFormSubmit}>
          <input
            type="file"
            name="file"
            accept=".xlsx"
            onChange={e => this.onChange(e)}
          />
        </div>
      </div>
    </div>
  );
}

export default App;
